social_posts.post_text:
It’s that time of the year again, we’re at the end of an old year + start of a new year and let’s be real - most of us keep our NYE resolutions for maybe the first month or so of the year and then a little thing called life gets in the way. But… I’m challenging myself this year to think big picture and enjoy every step of the journey in accomplishing my goals; Whether that be finally starting on that screenplay i’ve been talking about for years this summer; 
Or reconnecting with family i haven’t spoken to in awhile; 
Or maybe starting that second business i’ve been thinking about for the last few months (i did it ‼️); 
Making time for ME while still holding myself entirely accountable; But knowing the difference in taking my time and really giving 200% to every single thing I do this year; 
And a major part of that is @happycaps.official - If you know me irl, i’m kind of spazzy as hell and tend to work myself into a ball of anxiety especially when working on something new that i’m hyper focused and beyond excited for - And ever since I started microdosing (medicinally, researched, all of the above) which was something i’d been curious about for awhile, soooooo many of those anxiety symptoms that come with my career choice, personality, and general standard i hold myself to noticeably started going wayyy down - and the best part is that it’s entirely organic + actually helps with active memory retention which as an actor with 5+ page scenes on a weekly basis, is an absolute game changer. Let’s make 2023 our year bb’s and kick some ass 🫶🏼✨💫🥹
